import React, { useState, useEffect } from 'react';

const MapFoodType = () => {
  const [selectedRestaurant, setSelectedRestaurant] = useState(null);
  const [map, setMap] = useState(null);
  const [markers, setMarkers] = useState([]);
  const [selectedFoodType, setSelectedFoodType] = useState([]);

  useEffect(() => {
    const script = document.createElement('script');
    script.src =
      'https://dapi.kakao.com/v2/maps/sdk.js?appkey=0560729fbda53d06035a69b6f812c484&libraries=services';
    script.async = true;
    script.onload = () => {
      const mapOptions = {
        center: new window.kakao.maps.LatLng(36.773536, 126.933500),
        level: 2,
      };

      const mapInstance = new window.kakao.maps.Map(
        document.getElementById('map'),
        mapOptions
      );
      setMap(mapInstance);

      fetch('/mapfoodtype', {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
        },
        credentials: 'include',
      })
      
        .then((response) => response.json())
        .then((data) => {
          if (data && data.length > 0) {
            // 데이터가 비어 있지 않으면 출력
            console.log(data);
            const positions = data.map((item) => ({
              title: item.title,
              latlng: new window.kakao.maps.LatLng(item.latitude, item.longitude),
              type: item.type,
              number: item.phone_number,
              menu: item.menu,
            }));

            setMarkers(
              positions.map((position) => {
                const marker = new window.kakao.maps.Marker({
                  position: position.latlng,
                  map: mapInstance,
                });
                const infowindow = new window.kakao.maps.InfoWindow({
                  content: `<div style="padding:5px;">${position.title}</div>`,
                  removable: true,
                });

                window.kakao.maps.event.addListener(marker, 'click', () => {
                  infowindow.open(map, marker);
                  setSelectedRestaurant(position);
                });

                return { ...position, marker, infowindow };
              })
            );
          } else {
            console.log('데이터가 비어 있습니다.');
          }
        })
        .catch((error) => {
          console.error('데이터를 가져오는 중 오류 발생:', error);
        });
    };
    document.head.appendChild(script);
  }, []);

  const handleFoodTypeClick = (foodType) => {
    if (selectedFoodType.includes(foodType)) {
      setSelectedFoodType(selectedFoodType.filter((type) => type !== foodType));
    } else {
      setSelectedFoodType([...selectedFoodType, foodType]);
    }
  };

  useEffect(() => {
    if (map) {
      markers.forEach((marker) => {
        const isVisible =
          selectedFoodType.length === 0 || selectedFoodType.some((type) => marker.type === type);
        marker.marker.setMap(isVisible ? map : null);
      });
    }
  }, [map, selectedFoodType, markers]);

  return (
    <div>
      <div id="map" style={{ width: '100%', height: '500px', margin: '0 auto' }}></div>
      {selectedRestaurant && (
        <div className="restaurant-info">
          <h3>{selectedRestaurant.title}</h3>
          <p>전화번호: {selectedRestaurant.number}</p>
          <p>대표메뉴: {selectedRestaurant.menu}</p>
        </div>
      )}
      <div className="food-type-buttons">
        <button onClick={() => handleFoodTypeClick('')} className={selectedFoodType.length === 0 ? 'active' : ''}>
          전체
        </button>
        <button onClick={() => handleFoodTypeClick('한식')} className={selectedFoodType.includes('한식') ? 'active' : ''}>
          한식
        </button>
        <button onClick={() => handleFoodTypeClick('중식')} className={selectedFoodType.includes('중식') ? 'active' : ''}>
          중식
        </button>
        <button onClick={() => handleFoodTypeClick('일식')} className={selectedFoodType.includes('일식') ? 'active' : ''}>
          일식
        </button>
        <button onClick={() => handleFoodTypeClick('양식')} className={selectedFoodType.includes('양식') ? 'active' : ''}>
          양식
        </button>
        <button onClick={() => handleFoodTypeClick('패스트푸드')} className={selectedFoodType.includes('패스트푸드') ? 'active' : ''}>
          패스트푸드
        </button>
        <button onClick={() => handleFoodTypeClick('분식')} className={selectedFoodType.includes('분식') ? 'active' : ''}>
          분식
        </button>
        <button onClick={() => handleFoodTypeClick('기타')} className={selectedFoodType.includes('기타') ? 'active' : ''}>
          기타
        </button>
      </div>
    </div>
  );
};

export default MapFoodType;
